import * as React from "react";
import gql from "graphql-tag";
import { useQuery, useMutation, useLazyQuery, useApolloClient } from "@apollo/react-hooks";

//
// GraphQL 
//

const GET_COMPANY_SETTINGS_BY_ID = gql`
  query getCompanyById($CompanyId: ID!, $PopulateInput:PopulateInput!) {
    getCompanyById(CompanyId:$CompanyId, PopulateInput:$PopulateInput) {
      inviteEmails {
        _id
        email
        reminded
        accepted
        invitedBy
      }
    }
  }
`;
const SEND_COMPANY_INVITE_VIA_EMAIL = gql`
  mutation sendCompanyInviteViaEmail($CompanyId: ID!, $EmailList:[EmailListItemInput]!) {
    sendCompanyInviteViaEmail(CompanyId:$CompanyId, EmailList:$EmailList)
  }
`;
// Style
import './GutterUserInvites.styl'; 
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { 
    faArrowRight
} from '@fortawesome/free-solid-svg-icons'


type GutterUserInvitesProps = {
    userCookie
    toggleGutter
    toggleMenu
    toggleGutterLoader
}

//
// Function
//

const GutterUserInvites: React.FunctionComponent<GutterUserInvitesProps> = (props:any) => {
    // Set States
    const [companyInvites, setCompanyInvites] = React.useState(null);
    const [companyAcceptedInvites, setCompanyAcceptedInvites] = React.useState(null);
    const [companyAwaitingInvites, setCompanyAwaitingInvites] = React.useState(null);
    const [toggleAccepted, setToggleAccepted] = React.useState(false); 
    // GraphQL - Q's
    const [ callCompanySettingsById, { loading, data, error }] = useLazyQuery(GET_COMPANY_SETTINGS_BY_ID, {
        fetchPolicy: "no-cache"
    });
    // GraphQL - M's
    const [ submitInvites, { loading:submitInvitesloading, error:submitInvitesError }] = useMutation(SEND_COMPANY_INVITE_VIA_EMAIL);

    //
    // Use Effect
    //

    React.useEffect(() => {
        if(error && !loading) {
            console.log(`Error ${error}`);
        } else {
            if(!data) {
                callCompanySettingsById({
                    variables:{
                        "CompanyId": "5ddd3993dae01149faf416ff",
                        "PopulateInput": {
                        "key": "",
                        "skip": 0,
                        "limit": 1
                        }
                    }
                });
            } else {
                const accepted = [];
                const awaiting = [];
                data.getCompanyById.inviteEmails.map((value, index) =>{
                    if(value.accepted) {
                        accepted.push(value);
                    } else {
                        awaiting.push(value);
                    }
                });
                setCompanyAcceptedInvites(accepted);
                setCompanyAwaitingInvites(awaiting);      
            } 
        }
    },[loading, data, error]); 

    //
    // Delete User Invite
    //

    const deleteUserInvite = async (value, index) => {

    }

    //
    // Delete User Invite
    //

    const sendUserInviteReminder = async (value, index) => {
        props.toggleGutterLoader(true,'loading','Preping Invites','Please wait');
        try {
            const res = await submitInvites({
              variables: {
                CompanyId:'5ddd3993dae01149faf416ff',
                EmailList:["email":value.email]
              }
            });
            if(res && res.data.sendCompanyInviteViaEmail) {
                if(await res.data.sendCompanyInviteViaEmail) {
                    props.toggleGutterLoader(true,'success','Good Stuff','Invites Sent');
                    const timer = setTimeout(() => {
                        props.toggleGutterLoader(false,'success','Good Stuff','Invites Sent');
                    }, 4000);
                    return () => clearTimeout(timer);
                }
            }
          } catch(err) {
            props.toggleGutterLoader(true, 'error', 'Error', err);
            const timer = setTimeout(() => {
              props.toggleGutterLoader(false, 'error', 'Error', err);
            }, 4000);
            return () => clearTimeout(timer);
          }

    }

    //
    // Return
    //

    return (
        <>
            <div className="gutter-user-invites">
                <div className="invites-header">
                    <h1>User Invitations</h1>
                    <div className="header-back-button" onClick={(event) => props.toggleGutter('','one-active')}><FontAwesomeIcon icon={faArrowRight}/></div>
                </div>
                <div className="invites-select">
                    <div className={`select-button ${!toggleAccepted ? 'select-button-active' : ''}`}  onClick={(event) => setToggleAccepted(false) }>Awaiting</div>
                    <div className={`select-button ${toggleAccepted ? 'select-button-active' : ''}`}  onClick={(event) => setToggleAccepted(true) }>Accepted</div>
                </div>
                <div className="invites-total">
                    <div className="total-split">
                        <div className="split-number">{companyAwaitingInvites && companyAcceptedInvites && companyAcceptedInvites.length + companyAwaitingInvites.length}</div>
                        <div className="split-label">Total</div>
                    </div>
                    <div className="total-split">
                        <div className="split-number">{companyAcceptedInvites && companyAcceptedInvites.length}</div>
                        <div className="split-label">Accepted</div>
                    </div>
                </div>
                {companyAcceptedInvites && toggleAccepted && companyAcceptedInvites.map((value, index) => {
                    return (
                        <div className="invites-item" key={index}>
                            {value.email}
                        </div>
                    )    
                })}
                {companyAwaitingInvites && !toggleAccepted && companyAwaitingInvites.map((value, index) => {
                    return (
                        <div key={index}>      
                            <div className="invites-item">
                                {value.email}
                                <div className="item-date">Invited on 17th July 2018</div>
                                <div className="item-footer">
                                    <div className="footer-remove-button"  onClick={(event) => deleteUserInvite(value, index) }>Remove</div>
                                    <div className="footer-remind-button"  onClick={(event) => sendUserInviteReminder(value, index) }>Send Reminder</div>
                                    <div className="clear-float"></div>
                                </div>
                            </div>
                        </div>
                    )    
                })}
            </div>

        </>
    );
};

export default GutterUserInvites;
